import MotionHoc from "./MotionHoc";
import styled from "styled-components";
const Section = styled.div`
    background-color: black;
`;

const HomeComponent = () => {
  return <Section>
          <h1>Skov.</h1>
        </Section>;
};

const Home = MotionHoc(HomeComponent);

export default Home;
